import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from 'react-router-dom';
import Home from './pages/Home.js';
import Services from './pages/Services.js';
import Help from './pages/Help.js';
import About from './pages/About.js';
import Family from './pages/Family.js';
import Story from './pages/Story.js';

function App()
{
    return (
        <Router>
            <div>
                <nav>
                    <Link to="/">Home</Link>
                    <Link to="/services">Our Services</Link>
                    <Link to="/services/get-help">Get Help</Link>
                    <Link to="/about">About Us</Link>
                    <Link to="/souls-family">Little Souls Family</Link>
                    <Link to="/our-story">Our Story</Link>
                </nav>
            </div>

            <Switch>
                <Route exact path="/">
                    <Home />
                </Route>
                <Route exact path="/services">
                    <Services />
                </Route>
                <Route exact path="/services/get-help">
                    <Help />
                </Route>
                <Route exact path="/about">
                    <About />
                </Route>
                <Route exact path="/souls-family">
                    <Family />
                </Route>
                <Route exact path="/our-story">
                    <Story />
                </Route>
            </Switch>
        </Router>
    );
}

export default App;
